    <script>
        function kaifa(){
            document.getElementById("kaifa").style.display="block"
        }
        function questionEncode(){
            document.getElementById("questionDecode").value = encode64(document.getElementById("questionDecode").value)
        }
        function IsPC() {
                var Agents = ["Android", "iPhone","SymbianOS", "Windows Phone","iPad", "iPod"];
                var flag = true;
                for (var v = 0; v < Agents.length; v++) {
                    if (navigator.userAgent.indexOf(Agents[v]) > 0) {
                        flag = false;
                        break;
                    }
                }
                return flag;
        }
        var keyStr = "ABCDEFGHIJKLMNOP" +"QRSTUVWXYZabcdef" +"ghijklmnopqrstuv" +"wxyz0123456789+/" +"=";
        function encode64(input){
            input = escape(input);
            var output = "";
            var chr1, chr2, chr3 = "";
            var enc1, enc2, enc3, enc4 = "";
            var i = 0;
            do
            {
            chr1 = input.charCodeAt(i++);
            chr2 = input.charCodeAt(i++);
            chr3 = input.charCodeAt(i++);
            enc1 = chr1 >> 2;
            enc2 = ((chr1 & 3) << 4) | (chr2 >> 4);
            enc3 = ((chr2 & 15) << 2) | (chr3 >> 6);
            enc4 = chr3 & 63;
            if (isNaN(chr2))
            {
            enc3 = enc4 = 64;
            }
            else if (isNaN(chr3))
            {
            enc4 = 64;
            }
            output = output +
            keyStr.charAt(enc1) +
            keyStr.charAt(enc2) +
            keyStr.charAt(enc3) +
            keyStr.charAt(enc4);
            chr1 = chr2 = chr3 = "";
            enc1 = enc2 = enc3 = enc4 = "";
            } while (i < input.length);
            return output;
        }
        function decode64(input){
            var output = "";
            var chr1, chr2, chr3 = "";
            var enc1, enc2, enc3, enc4 = "";
            var i = 0;
            // remove all characters that are not A-Z, a-z, 0-9, +, /, or =
            var base64test = /[^A-Za-z0-9\+\/\=]/g;
            if (base64test.exec(input))
            {
            alert("There were invalid base64 characters in the input text.\n" +
            "Valid base64 characters are A-Z, a-z, 0-9, '+', '/', and '='\n" +
            "Expect errors in decoding.");
            }
            input = input.replace(/[^A-Za-z0-9\+\/\=]/g, "");
            do
            {
            enc1 = keyStr.indexOf(input.charAt(i++));
            enc2 = keyStr.indexOf(input.charAt(i++));
            enc3 = keyStr.indexOf(input.charAt(i++));
            enc4 = keyStr.indexOf(input.charAt(i++));
            chr1 = (enc1 << 2) | (enc2 >> 4);
            chr2 = ((enc2 & 15) << 4) | (enc3 >> 2);
            chr3 = ((enc3 & 3) << 6) | enc4;
            output = output + String.fromCharCode(chr1);
            if (enc3 != 64)
            {
            output = output + String.fromCharCode(chr2);
            }
            if (enc4 != 64)
            {
            output = output + String.fromCharCode(chr3);
            }
            chr1 = chr2 = chr3 = "";
            enc1 = enc2 = enc3 = enc4 = "";
            } while (i < input.length);
            return unescape(output);
        }
        function getRndInteger(min, max) {
            return Math.floor(Math.random() * (max - min) ) + min;
        }
        function addquestion(question="",options="",answer="",id,type){
            //alert("enter");
            var outer=document.createElement("div");
            if(type==1 || type==3){//单选或者判断
                outer.innerHTML="<p>"+(id+1)+". "+question+"&nbsp;&nbsp;<lable class=answer style=display:none>"+answer+"</lable>"+"</p>"+"<p>"+options.replace(/A./,"<input type=radio name="+type+id+" value=A>A.").replace(/B./,"<input type=radio name="+type+id+" value=B>B.").replace(/C./,"<input type=radio name="+type+id+" value=C>C.").replace(/D./,"<input type=radio name="+type+id+" value=D>D.")+"</p><hr>";
            }else{//多選
                //outer.innerText="dddd"
                outer.innerHTML= "<p>"+(id+1)+". "+question+"&nbsp;&nbsp;<lable class=answer style=display:none>"+answer+"</lable>"+"</p>"+"<p>"+options.replace(/A./,"<input type=checkbox name="+type+id+" value=A>A.").replace(/B./,"<input type=checkbox name="+type+id+" value=B>B.").replace(/C./,"<input type=checkbox name="+type+id+" value=C>C.").replace(/D./,"<input type=checkbox name="+type+id+" value=D>D.").replace(/E./,"<input type=checkbox name="+type+id+" value=E>E.")+"</p><hr>";
            }
            //console.log("test");
            //alert("写入");
            document.getElementById("questions").appendChild(outer);
        }
        function displayAnswer(){
            var lables=document.getElementsByClassName("answer");
            //console.log(lables)
            var i = 0;
            while (i < lables.length){
                lables[i].style.display="";
                i=i+1;
            }
        }
    </script>

        }

        while(mode!=3){
            var i=0
            var historystr="#";
            //console.log(document.getElementById("qnum").value)
            switch(mode){
                case 0:
                    type=1;
                    tm = "danx";//danxnum
                    tishi="单选"
                    count = document.getElementById("danxnum").value;
                    //alert(count);
                    break;
                case 1:
                    type=2;
                    tm = "duox";
                    tishi="多选"
                    count = document.getElementById("duoxnum").value;
                    break;
                case 2:
                    type=3;
                    tm = "pand";

            //alert(tm);

                while(goon){

                    }else{

                        historystr=historystr+"#"+randomNum
                        //alert(historystr)
                    }
                }
                //console.log(historystr)
                console.log(type,randomNum,tm,json[tm][randomNum]);
                addquestion(json[tm][randomNum][0],json[tm][randomNum][1],json[tm][randomNum][2],i,type);
                i=i+1;
            }
            //alert("over")
            mode = mode+1
        }
